insert  into `oc_information_description`(`information_id`,`language_id`,`title`,`description`,`meta_title`,`meta_description`,`meta_keyword`) values (4,4,'Impressum','&lt;h4&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Sushi Bento GmbH&lt;/span&gt;&lt;/h4&gt;&lt;p&gt;Geschäftsführender Gesellschafter: Pham Thai Hung – Pham Minh Khue &lt;br&gt;StNr.: 143/184/11507&lt;br&gt;UST-ID: DE 296810024&lt;br&gt;Amtsgericht München HRB 214347&lt;/p&gt;&lt;h4&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Kontakt :&lt;/span&gt;&lt;/h4&gt;&lt;p&gt; Webseite:&amp;nbsp; www.sushibento.de&lt;br&gt;Email: info@sushibento.de&lt;br&gt;Tel. +49 (0) 163 69 2 69 55&lt;/p&gt;&lt;h4&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Urherberrechte:&lt;/span&gt;&lt;/h4&gt;&lt;p&gt;Alle\r\n Texte und Bilder sind urheberrechtlich geschützt. Alle Rechte sind \r\nvorbehalten. Reproduktionen gleich welcher Art nur mit schriftlicher \r\nGenehmigung des Herausgebers. Aus der Veröffentlichung kann nicht \r\ngeschlossen werden, daß die verwendeten Bezeichungen frei von \r\ngewerblichen Schutzrechten sind.&lt;/p&gt;&lt;h4&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Hinweise:&lt;/span&gt;&lt;/h4&gt;&lt;p&gt;Hiermit\r\n distanzieren wir uns ausdrücklich von allen Inhalten aller verlinkten \r\nSeiten im Internetauftritt von Asiakueche und machen uns diese Inhalte \r\nnicht zu eigen. Diese Erklärung gilt für alle in diesen Seiten \r\nveröffentlichen Links, die auf Seiten verweisen, die außerhalb der \r\nDomain www.sushibento.de.de liegen. Sollten Sie mit dem Inhalt einer der\r\n verlinkten URLs nicht einverstanden sein, dann bitten wir Sie, diese \r\nnicht zu öffnen und uns umgehend zu informieren info@sushibento.de, \r\ndamit wir diesen Link erneut überprüfen und gegebenenfalls aus dem \r\nArchiv entfernen können.&lt;/p&gt;','Impressum','',''),(3,1,'Allgemeine Geschäftsbedingungen','Alle unsere Speisen werden direkt nach der Bestellung frisch zubereitet. In der Regel dauert die Zustellung innerhalb der Stadtgrenze - u.a. je nach Auftragsvolumen, Verkehrsverhältnissen und Witterung – zwischen 25 und 75 Minuten.( Natürlich wir versuchen einen schnelle wie möglich)&lt;br&gt;&lt;br&gt;Sollte die Bestellung doch einmal länger bis zur Auslieferung dauern, so erhält der Kunde aus Kulanz ab der 90. Minute 10 Prozent Rabatt auf den aktuellen Bestellwert.&lt;br&gt;&lt;br&gt;Der Rabattbetrag wird bei Bargeld-Rechnungen direkt bei Ankunft des Fahrers von der Rechnung abgezogen.&lt;br&gt;&lt;br&gt;Im Fall von bereits onlinebezahlten (bargeldlosen) Rechnungen wird der Rabattbetrag aus abrechnungstechnischen Gründen für die nächste Bestellung im Bestellsystem gutgeschrieben.&lt;br&gt;Die nachträgliche Inanspruchnahme des Rabattbetrags ist ausgeschlossen. Der Rabattbetrag kann ausschließlich beim Eintreffen des Fahrers festgestellt und geltend gemacht werden.&lt;br&gt;Es gilt die Bestellzeit, die auf der Rechnung ausgewiesen ist.&lt;br&gt;Im Fall von Nachbestellungen gilt die Bestellzeit der Nachbestellung, die auf der Rechnung ausgewiesen ist.&lt;br&gt;Lieferungen nach der 90. Minute außerhalb der Stadtgrenze sind ausgeschlossen.&lt;br&gt;Im Fall von Nachbestellungen gilt die Bestellzeit der Nachbestellung, die auf der Rechnung ausgewiesen ist.&lt;br&gt;Bedingungen für die Inanspruchnahme von Rabatten bei verspäteter Lieferung:&lt;br&gt;Der Kunde muss auf der zu rabattierenden Rechnung handschriftlich den Begriff &quot;Ankunft&quot;, die &quot;Uhrzeit&quot; und seine Unterschrift verzeichnen.&lt;br&gt;&lt;br&gt;Korrekte Adressdaten (Name, evtl. Firma, Straße, Postleitzahl, Ort), Telefonnummer und telefonische Erreichbarkeit des Bestellers (für evtl. Rückfragen).&lt;br&gt;Änderungen und Irrtümer vorbehalten.&lt;br&gt;Der Rechtsweg ist ausgeschlossen.&lt;br&gt;&lt;br&gt;&lt;br&gt;','Datenschutz','',''),(6,1,'Info','&lt;p&gt;&lt;/p&gt;\r\n\r\n\r\n	\r\n	\r\n	\r\n	&lt;style type=&quot;text/css&quot;&gt;A:link {  }&lt;/style&gt;\r\n\r\n\r\n	\r\n	\r\n	\r\n	&lt;sty