ormieren info@sushibento.de, \r\ndamit wir diesen Link erneut überprüfen und gegebenenfalls aus dem \r\nArchiv entfernen können.&lt;/p&gt;','Impressum','',''),(3,4,'Allgemeine Geschäftsbedingungen','Alle unsere Speisen werden direkt nach der Bestellung frisch zubereitet. In der Regel dauert die Zustellung innerhalb der Stadtgrenze - u.a. je nach Auftragsvolumen, Verkehrsverhältnissen und Witterung – zwischen 25 und 75 Minuten.( Natürlich wir versuchen einen schnelle wie möglich)&lt;br&gt;&lt;br&gt;Sollte die Bestellung doch einmal länger bis zur Auslieferung dauern, so erhält der Kunde aus Kulanz ab der 90. Minute 10 Prozent Rabatt auf den aktuellen Bestellwert.&lt;br&gt;&lt;br&gt;Der Rabattbetrag wird bei Bargeld-Rechnungen direkt bei Ankunft des Fahrers von der Rechnung abgezogen.&lt;br&gt;&lt;br&gt;Im Fall von bereits onlinebezahlten (bargeldlosen) Rechnungen wird der Rabattbetrag aus abrechnungstechnischen Gründen für die nächste Bestellung im Bestellsystem gutgeschrieben.&lt;br&gt;Die nachträgliche Inanspruchnahme des Rabattbetrags ist ausgeschlossen. Der Rabattbetrag kann ausschließlich beim Eintreffen des Fahrers festgestellt und geltend gemacht werden.&lt;br&gt;Es gilt die Bestellzeit, die auf der Rechnung ausgewiesen ist.&lt;br&gt;Im Fall von Nachbestellungen gilt die Bestellzeit der Nachbestellung, die auf der Rechnung ausgewiesen ist.&lt;br&gt;Lieferungen nach der 90. Minute außerhalb der Stadtgrenze sind ausgeschlossen.&lt;br&gt;Im Fall von Nachbestellungen gilt die Bestellzeit der Nachbestellung, die auf der Rechnung ausgewiesen ist.&lt;br&gt;Bedingungen für die Inanspruchnahme von Rabatten bei verspäteter Lieferung:&lt;br&gt;Der Kunde muss auf der zu rabattierenden Rechnung handschriftlich den Begriff &quot;Ankunft&quot;, die &quot;Uhrzeit&quot; und seine Unterschrift verzeichnen.&lt;br&gt;&lt;br&gt;Korrekte Adressdaten (Name, evtl. Firma, Straße, Postleitzahl, Ort), Telefonnummer und telefonische Erreichbarkeit des Bestellers (für evtl. Rückfragen).&lt;br&gt;Änderungen und Irrtümer vorbehalten.&lt;br&gt;Der Rechtsweg ist ausgeschlossen.&lt;br&gt;&lt;br&gt;&lt;br&gt;','Allgemeine Geschäftsbedingungen','',''),(6,4,'Info','&lt;p&gt;&lt;/p&gt;\r\n\r\n\r\n	\r\n	\r\n	\r\n	&lt;style type=&quot;text/css&quot;&gt;A:link {  }&lt;/style&gt;\r\n\r\n\r\n	\r\n	\r\n	\r\n	&lt;style type=&quot;text/css&quot;&gt;A:link {  }&lt;/style&gt;\r\n\r\n\r\n	\r\n	\r\n	\r\n	&lt;style type=&quot;text/css&quot;&gt;H1.western { font-family: &quot;Times New Roman&quot;,serif; }H1.cjk { font-family: &quot;Arial Unicode MS&quot;; }H1.ctl { font-family: &quot;Arial Unicode MS&quot;; }A:link {  }&lt;/style&gt;\r\n\r\n\r\n	\r\n	\r\n	\r\n	&lt;style type=&quot;text/css&quot;&gt;H1.western { font-family: &quot;Times New Roman&quot;,serif; }H1.cjk { font-family: &quot;Arial Unicode MS&quot;; }H1.ctl { font-family: &quot;Arial Unicode MS&quot;; }A:link {  }&lt;/style&gt;\r\n\r\n\r\n	\r\n	\r\n	\r\n	&lt;style type=&quot;text/css&quot;&gt;H1.western { font-family: &quot;Times New Roman&quot;,serif; }H1.cjk { font-family: &quot;Arial Unicode MS&quot;; }H1.ctl { font-family: &quot;Arial Unicode MS&quot;; }A:link {  }&lt;/style&gt;\r\n\r\n\r\n	\r\n	\r\n	\r\n	&lt;style type=&quot;text/css&quot;&gt;H1.western { font-family: &quot;Times New Roman&quot;,serif; }H1.cjk { font-family: &quot;Arial Unicode MS&quot;; }H1.ctl { font-family: &quot;Arial Unicode MS&quot;; }A:link {  }&lt;/style&gt;&lt;h6&gt;\r\n\r\n&lt;/h6&gt;&lt;h3 style=&quot;    line-height: 1.6;&quot;&gt;\r\n\r\n\r\n	\r\n	\r\n	\r\n	&lt;style type=&quot;text/css&quot;&gt;H1.western { font-family: &quot;Times New Roman&quot;,serif; }H1.cjk { font-family: &quot;Arial Unicode MS&quot;; }H1.ctl { font-family: &quot;Arial Unicode MS&quot;; }A:link {  }&lt;/style&gt;\r\n\r\n\r\n&lt;/h3&gt;\r\n\r\n\r\n	\r\n	\r\n	\r\n	&lt;style type=&quot;text/css&quot;&gt;H1.western { font-family: &quot;Times New Roman&quot;,serif; }H1.cjk { font-family: &quot;Arial Unicode MS&quot;; }H1.ctl { font-family: &quot;Arial Unicod